import React from 'react';
import './ResultContainer.css';
import ResultItem from '../../components/ResultItem/ResultItem.js';


const resultContainer = (props) => {
  const locationList =  [...props.locations];

  const locations = locationList.map((location) => {
    return location.Area  === props.filter.Area && location.Type === props.filter.Type ?
    <ResultItem image={location.ImageName}/>

    : null;

    // if(location.Area  === props.filter.Area && location.Type === props.filter.Type){
    //   return <ResultItem />
    // }
    // else {
    //   return null;
    // }
  });

  return(
    <div className="resultContainer--container">
    {locations}
    </div>
  );
}

export default resultContainer;
